using Components;using System;using MessagePack;using HECSFramework.Serialize;using Commands;namespace HECSFramework.Core{	[MessagePackObject, Serializable]	public partial struct ViewReferenceComponentResolver : IResolver<ViewReferenceComponent>, IResolver<ViewReferenceComponentResolver,ViewReferenceComponent>, IData	{		[Key(0)]		public string AssetReferenceGuid;		public ViewReferenceComponentResolver In(ref ViewReferenceComponent viewreferencecomponent)		{			viewreferencecomponent.BeforeSync();			this.AssetReferenceGuid = viewreferencecomponent.AssetReferenceGuid;			return this;		}		public void Out(ref Entity entity)		{			var local = entity.GetComponent<ViewReferenceComponent>();			Out(ref local);		}		public void Out(ref ViewReferenceComponent viewreferencecomponent)		{			viewreferencecomponent.AssetReferenceGuid = this.AssetReferenceGuid;			viewreferencecomponent.AfterSync();		}	}}